import React, { Fragment } from 'react';
import styled from 'styled-components';

const ContentsWrapper = styled.input`
  color: red;
`

const Contents = () => {
  return (
    <>
      <h1>React</h1>
      <h2>사용자 인터페이스를 만들기 위한 JavaScript 라이브러리</h2>
      <ContentsWrapper>
      <ContentsWrapper type='submit' value='시작하기'/> 자습서 읽어보기
      </ContentsWrapper>
    </>
  )
}

export default Contents;
